import * as React from "react";
import Slides from "./slides";

import "./slides.example.scss";
import SlidesItem from "./slidesItem";

const SlidesExample: React.FunctionComponent = () => {
    const imgs = [
        {
            src: "https://tse4-mm.cn.bing.net/th?id=OIP.PZpHsaris4oOLgZKmbZJFwHaEK&w=300&h=168&c=7&o=5&dpr=2&pid=1.7",
            id: "抽象"
        },
        {
            src: "https://tse4-mm.cn.bing.net/th?id=OIP.X1B-XwIEHn6xiu2oEFURkgHaEK&w=300&h=168&c=7&o=5&dpr=2&pid=1.7",
            id: "风景"
        },
        {
            src: "data:image/jpeg;base64,",
            id: "动漫"
        },
        {
            src: "https://tse1-mm.cn.bing.net/th?id=OIP.dWM43aVyloh7oNs4x9xAIgHaEK&w=297&h=167&c=7&o=5&dpr=2&pid=1.7",
            id: "诗意"
        }
    ];
    const lists = imgs.map(
        data =>
            <SlidesItem
                key={data.id}
                ID={data.id}
                delay={2}
                animationType={"linear"}
                style={{width: "60vw", height: "35vw"}}>
                <img src={data.src} alt="img"/>
            </SlidesItem>
    );
    return (
        <div className="yr-slides-example">
            <Slides
                default={"风景"}
                delay={2}
            >
                {lists}
            </Slides>
        </div>
    );
};

export default SlidesExample;